	<script>
		var clickTag = "http://www.google.com";
		document.querySelector("#banner").addEventListener('click', function (e) {
			window.open(clickTag);
			void(0);
		}, false);

		var video = document.querySelector('.s1_video')
		
		function playVideo() {
			video.play()
		}
		playVideo()
		
		
		window.onload = () => {
			var duration = 10 * 1000
			var divs = document.querySelectorAll('#banner div')
			
			function resetAnimation() {
				for (var i = 0; i < divs.length; i++) {
					var className = divs[i].className
					divs[i].className = ''
					playVideo()

					void divs[i].offsetWidth
					divs[i].className = className
				}
				setTimeout(resetAnimation, duration)
			}
			setTimeout(resetAnimation, duration)
		}
	</script>
